import React from 'react';
import ReactDom from 'react-dom'
import './index.css';

const itemName = "Iron";
const img = "https://static.wikia.nocookie.net/minecraft_gamepedia/images/f/fc/Iron_Ingot_JE3_BE2.png";
// stateless functional component (must captialize the first character)
function App() {
  // return JSX/Html
  return (
    <React.Fragment>
      <h4>Title</h4>
      <section className='itemlist'>
        <Item />
        <Item />
        <Item />
      </section>
    </React.Fragment>
  );
}

const Item = (props) => {
  return (
    <React.Fragment>
      <article className='item'>
        <ItemImage/>
        <ItemName/>
      </article>
    </React.Fragment>
  )
}

const ItemImage = () => {
  return (
    <img src={img} alt="iron.png" width="50" height="50"/>
  )
}

const ItemName = () => {

  return (
    <h2 style={{color: '#617d98'}}>
    {itemName}
    </h2>
  )
}
ReactDom.render(<App/>, document.getElementById('root'));
